//SPDX-License-Identifier: MIT

//MODIFIERS
//DECIDE A WINNER

pragma solidity ^0.8.7;

contract Poll {

    address public owner;

    constructor() {
        owner = msg.sender;
    }

    struct Proposal {
        string description;
        uint totalVotes;
    }

    mapping(uint => mapping(uint => Proposal)) public campaigns;

    mapping(address => mapping(uint => bool)) public alreadyVoted;

    function createCampaign(uint _campId, uint _propId, string memory _desc) external {
        campaigns[_campId][_propId].description = _desc;
        campaigns[_campId][_propId].totalVotes = 0;
    }

    function vote(uint _camp, uint _prop) external returns(bool) {
        require(!alreadyVoted[msg.sender][_camp], "Already voted in this campaign");

        alreadyVoted[msg.sender][_camp] = true;

        campaigns[_camp][_prop].totalVotes += 1;

        return true;
    }
}
